// General
body {
    margin: 0px;
    padding: 0px;
}

#allContainer {
    background-color: aqua;
    margin-left: auto;
    margin-right: auto;
    top: 0px;
    width: 80%;
}

.fill-space {
    // llena el espacio Horizontal  empujando elementos a su alrededor
    flex: 1 1 auto;
}

//Tabs
.tabTrigger {
    display: none;
    padding: 0%;
}

input:checked+.tabContent {
    display: block;
}

.tabContent {
    display: none;
}

header {
    flex: auto;
    height: 100px;
    background-color: red;
    justify-content: space-between;
    position: fixed;
    width: 80%;
    .tabContainer {
        display: inline-flex;
        justify-content: center;
        width: 30%;
        padding: 10px;
        background-color: blue;
        img {
            display: block;
            max-width: 40px;
        }
        label {
            align-content: flex-end;
        }
    }
}

// Contenido
.contenido {
    padding-top: 100px;
}

// Footer
footer {
    background-color: aquamarine;
    position: relative;
    bottom: 0px;
    width: 100%;
    #footerTop {
        justify-content: space-between;
        display: flex;
        #FAQ {
            a {
                text-decoration: none;
            }
        }
        #socialMedia {
            padding-top: 20px;
            padding-right: 20px;
            img {
                max-width: 50px;
            }
        }
    }
    #footerBot {
        text-align: center;
    }
}

